B.H9=new A.a4("Run at Rate on SQMS","Start: -28 - End: -28","This is a checkpoint for the supplier to have all Run at Rate information for each PN uploaded and on demonstrated capable status on SQMS.","The Wiring SQE is responsible of requesting the supplier to perform this activity and approve the information uploaded into SQMS by the supplier.","SQMS","Launch, Phase 2  PVVB MRD to NS PPAP")
