B.HN=new A.a4("PDCA Wall Review","Start: -77 - End: -8","The PDCA Wall Review is a series of reviews to assess the readiness for production of a specific supplier facility through the Global Vehicle Development Plan. The focus is to assess product and process readiness within APQP Scope & Timeline for HR, Facility, Manufacturing and Engineering, Material Operations and BIQS Glidepath; understand and establish Risk Mitigation at the supplier site.","The Wiring SQE is responsible of scheduling this review including his/her team leader, manager, PSDS regional process lead and SQ launch engineer at least once per month at the supplier facility (preferred) and get the supplier responsible of each area to present the status starting since the supplier nomination until the supplier reaches Full PPAP approval.","GM 1927 31a\nGM 1927 31b\nGM 1927 05","Launch, Phase 1 KO to PVVB MRD")
B.HA=new A.a4("Greenfield Facility Implementation Follow Up","Start: -77 - End: -49","Greenfield Facility Implementation Follow Up applies to brand new supplier manufacturing facilities (Greenfield) and existing supplier manufacturing facilities that are new to GM business (Brownfield) to ensure the supplier manufacturing site will be ready in terms of Facility, Organization, Operation, Purchasing and Supply Chain.","The Wiring SQE along with the SQ GF/BF coordinator is responsible of assessing at the supplier each of the items of the GM 1927 31 Greenfield Development Assessement Checklist and follow up on the plan to close and closure of all the items identified as non compliant before the PVVB builds. ","GM 1927 31","Launch, Phase 1 KO to PVVB MRD")
B.GT=new A.a4("Manufacturing Process Concept Review","Start: -74 - End: -74","The Manufacturing Process Concept Review is where the supplier presents to the wiring SQE the proposed layout including the details about the type of equipments they are going to use to meet Supplier Daily Capacity and detection levels for the failure modes already identified during sourcing, this presentation shall be aligned to what was presented during technical reviews, but including more detail in terms of equipment. ","The Wiring SQE is responsible of requesting this information to the supplier and asking them to present it. This revision can be part of the Manufacturing and Engineering portion of the PDCA Wall Review.","Quality Presentation from Sourcing\nIndustrialization Plan\nProposed Layout\nFlow Chart","Launch, Phase 1 KO to PVVB MRD")
B.Hd=new A.a4("D to PFMEA Gap Analysis","Start: -74 - End: -74","Supplier shall conduct D to P Gap Analysis based on the last DFMEA released and involve GM Purchasing, GM Engineering, GM SQE and Internal areas as they required. Supplier shall assure D to P gap analysis matchs with control detections committed during sourcing and safety lessons learned shared. Supplier shall request approval of transition forms as required","The Wiring SQE shall assure D to P gap analysis matchs with detection controls committed during sourcing and keep consider last safety lessons learned. Also, ensure the Transition forms are approved by Technical Specialist SQE.","DFMEA\nInitial PFMEA\nGM1927 21 DFMEA PFMEA Gap Analysis Process and Transition Form","Launch, Phase 1 KO to PVVB MRD")
B.Hx=new A.a4("Machinery PO's complete","Start: -74 - End: -72","Machinery PO's complete means supplier has placed all the Purchase Orders for machinery such as Cutting & Crimping machines, Twisting machines, Ultrasonic welding machines, Heatshrink ovens with the required tools and detections  and equipment so as cross section mini labs and Bubble Tester for the first phase of their industrialization plan.","The Wiring SQE is responsible of reviewing that the supplier has placed the required PO's for Crimping/Cutting, Twisting, Ultrasonic Welding, Terminal Soldering  and Seal Application equipments to meet the first phase of their industrialization plan, this includes confirming that the equipments  will have the required detections agreed during sourcing and that the estimated time of arrival is before starting to cut circuits for PVVB MRD.",u.E,"Launch, Phase 1 KO to PVVB MRD")
B.Hb=new A.a4("Dimensional & EOL Test Concept Approval","Start: -70 - End: -70","Dimensional & EOL Test Concept Approval is a revision where the supplier explains how their dimensional boards and end of line testers are going to work, including the type and amount of modules/features, tolerances, boards shape (dimensional board in 3D) and layout and software for quality analysis and traceability.","The Wiring SQE is responsible of scheduling this review including the PSDS regional process lead and approve these concepts before supplier starts building them, but only after all the requirements are met and lessons learned considered.","GM 1927 16a CG4210 PSDS SOR Section 11","Launch, Phase 1 KO to PVVB MRD")
B.Hc=new A.a4("Concept Vehicle Engineering Batch Release","Start: -70 - End: -66","Engineering design release for vehicle validation and PVVB Build.","","3D Math Data\nNetlist","Launch, Phase 1 KO to PVVB MRD")
B.HQ=new A.a4("DFMEA Complete","Start: -66 - End: -66","Design Failure Modes and Effects Analysis documents specific for the program closed and shared with the supplier, this should include the clarification / update of open items from previous gap analysis revisions / agreements.","The Wiring SQE shall verify Suppliers know about DFMEA updated and shared by GM Engineering, and it is considering last engineering level.\n-If Suppliers are Design owner, the DFMEA can be created by Supplier Engineering-\nManufacturing team shall demonstrate evidence of DFMEA is able to all team members at facility.","DFMEA\nGM 1927 21 DFMEA PFMEA Gap Analysis Process and Transition Form","Launch, Phase 1 KO to PVVB MRD")
B.Ht=new A.a4("Initial 2D release","Start: -66 - End: -62","The Wiring Harness 2D is the pictorical representation of the 3D math and Netlist for each harness family that the supplier uses to design their boards (assembly) and detailed manufacturing process for PVVB Builds and Supplier Engineering is responsible of drafting it, reviewing it and releasing it. ",u._,u.r,"Launch, Phase 1 KO to PVVB MRD")
