B.He=new A.a4("PVVB Process Control Plan Review","Start: -59 - End: -58",u.b,u.v,"Control Plan\nPFMEA","Launch, Phase 1 KO to PVVB MRD")
B.Ha=new A.a4("Current Tooling & Equipment Review","Start: -58 - End: -58","This checkpoint is to review the conditions of the existing equipment the supplier is intending to use for the project and if it has any gaps against GM requirements, so as to review the status of the delivery of the equipment from the Purchase Orders placed before to identify what is missing for the first MRD (PVVB).","The Wiring SQE is responsible of conducting this revision that can be either on site (preferably) or remote but ensuring supplier has all the details of the plan and that the equipment capabilities match the controls offered during sourcing and the D to P Gap Analysis so as that the capacity matches what was documented on the run at rate workbook. The wiring SQE should request the support from the Regional Process Lead, his/her Team Leader and Manager, this revision can be part of the agenda of the PDCA Wall Review, but making the supplier aware of the level of detail required so they can be prepared. This revision should occur before completing the CRV PVER Assessment in case there is any item that needs to be documented there.","Quality Presentation from Sourcing\nPFMEA\nControl Plan\nIndustrialization Plan","Launch, Phase 1 KO to PVVB MRD")
B.Ho=new A.a4("CRV PVER","Start: -58 - End: -58","CRV is a cross functional assessment that proactively confirms that PDT Quality Chain standard work is completed at PVER. The responsible for this valve is the validation engineer.","The Wiring SQE has to participate in this meeting and escalate any incomplete activity from this list and/or any potential issue that can put in risk a milestone.","CRV Assessment in Auros","Launch, Phase 1 KO to PVVB MRD")
B.H7=new A.a4("Production Vehicle Engineering Batch Release","Start: -60 - End: -56","Engineering design release for vehicle PPV Builds.","","","Launch, Phase 1 KO to PVVB MRD")
B.HP=new A.a4("PVER 2D Release","Start: -56 - End: -52","The Wiring Harness 2D is the pictorical representation of the 3D math and Netlist for each harness family that the supplier uses to design their boards (assembly and dimensional) and detailed manufacturing process; this will be the baseline to approve Non Saleable PPAP and Supplier Engineering is responsible of drafting it, reviewing it and releasing it. ",u._,u.r,"Launch, Phase 1 KO to PVVB MRD")
B.Hv=new A.a4("Reverse PFMEA Audit Checklist and Calendar","Start: -58 - End: -54","Reverse PFMEA is a Proactive - Go-and-See on-station review of all failure modes included in the PFMEA conducted by a cross-fuctional team, focused to verify that all the failure modes have proper controls (prevention/detection) and they are working properly.","The Wiring SQE is responsible of ensuring the supplier has a Reverse PFMEA Audit Checklist and a schedule to perform the Reverse PFMEA activity according GM 1927 36 Built In Quality Supply-Base (BIQS) Elements Presentation - Reverse PFMEA; Risk Reduction on each station shortly after the station is released and starts working continuously ensuring all of the intended stations for the project are coverd during the launch of the project.","GM 1927 36 Built In Quality Supply-Base (BIQS) Elements Presentation - Reverse PFMEA; Risk Reduction\nPFMEA\nReverse PFMEA Audit Checklist\nReverse PFMEA Calendar","Launch, Phase 1 KO to PVVB MRD")
B.HH=new A.a4("100% Subtiers Contracted","Start: -50 - End: -50","All Subtiers sending parts to the harness supplier for the harness assembly shall be identified and contracted by this week with an initial assessment on the GM 1925 25 Subcontractor Program Status Matrix to start working on their PPAP Plans.","The Wiring SQE is responsible of reviewing the supplier has identified all the required subtiers for each item on the BOM and there are not any commercial items opened, so as that the supplier has included all of those on the GM 1925 25 Subcontractor Program Status Matrix, this means columns A to C will be definitive from now on and columns D to H already have an initial assessment.","BOM\nGM 1925 25 Subcontractor Program Status Matrix","Launch, Phase 1 KO to PVVB MRD")
B.GX=new A.a4("MRD HVF Bld","Start: -49 - End: -49","The Harness Verification Frame Build occurs at PPO and is where all the Electrical Connections of the vehicle are made to validate electrical and electronic systems work as intended, suppliers are required to send fully functional (electrically) harnesses for this build.","The Wiring SQE should support the DRE to ensure the supplier sends the requested harnesses at the requested level.","PDT Meeting Minutes","Launch, Phase 1 KO to PVVB MRD")
B.GN=new A.a4("Hanking Concept Approval","Start: -50 - End: -48","GM Launch Electrical Wiring Coordinator and Launch Electrical Process Coordinator coordinate a Workshop with the Harness Supplier at PPO to get the hanking needed to protect the harness while processing the vehicle through the plant process without tucking the harness into openings in the vehicle that could cause damage.","The Wiring SQE is responsible of ensuring this workshop occurs and the outcome / agreements were properly documented, so that supplier can start working on releasing the Hanking 2D and Hanking instructions for the PVVB MRD.","BoO-Electrical - 317 - Harness Hanking Workshop","Launch, Phase 1 KO to PVVB MRD")
B.Hf=new A.a4("Subtiers PPAP Plan","Start: -50 - End: -48","At this stage, the Wiring supplier shall have agreed a plan with all the subtiers for PPAP submission, capacity demonstration and approval dates and downloaded the complete information into the GM 1925 25 Subcontractor Program Status Matrix.","The Wiring SQE is responsible of reviewing the supplier has the information required on each of the GM 1925 25 Subcontractor Program Status Matrix cells and that the dates considered in this file will not impact program milestones.",u.L,"Launch, Phase 1 KO to PVVB MRD")
B.GR=new A.a4("Tooling & Equipment Status","Start: -49 - End: -48","This a checkpoint to review all the equipment ordered for this stage is already at the plant and ready to start production.","The Wiring SQE is responsible of confirming that the equipments ordered for Crimping/Cutting, Twisting, Ultrasonic Welding, Terminal Soldering  and Seal Application are at the plant and have the required detections agreed during sourcing.",u.E,"Launch, Phase 1 KO to PVVB MRD")
B.H6=new A.a4("FPSO PVVB","Start: -47 - End: -47",u.B,u.Y,"FPSO Checklist","Launch, Phase 1 KO to PVVB MRD")
B.HT=new A.a4("PVVB CG4210 Compliance Audit","Start: -46 - End: -46",u.N,"The Wiring SQE is responsible of coordinating with his PSDS Regional Process Lead the date of the audit, so as ensuring the supplier sends their self assessment one week in advance and participating in the audit and following up on the open items with the supplier until those are closed.","GM 1927 16a Wiring Harness and Battery Cable Process/Commodity Audit\nM7 Form (Exception List)","Launch, Phase 1 KO to PVVB MRD")
B.H0=new A.a4("Dimensional & Attributes On Site Revision","Start: -46 - End: -46","The supplier shall provide evidence that dimensional verifications required by the 2D Drawing and the Control Plan have been completed and results indicate compliance with specified requirements.  The supplier shall have dimensional results for each unique manufacturing process, e.g., cells or production lines and record, with the actual results: all dimensions, characteristics, and specifications as noted on the design record and Control Plan. ","The Wiring SQE is responsible of coordinating this revision with the supplier and taking part of it making sure the harness measured as it comes out from the assembly line not after being reworked. The Wiring SQE is also responsible for following up on the open items until closure.","GM 1927 32 Dimensional Report","Launch, Phase 1 KO to PVVB MRD")
B.HY=new A.a4("MRD PVVB GA","Start: -44 - End: -44","The Production Vehicle Verification Build MRD is the first build MRD. For this phase General Assembly parts have to be off production tooling. ","The Wiring SQE should support the DRE to ensure the supplier manufactures the requested harnesses on the production intent tools at the requested engineering level and ships them to GM at the required date to meet the MRD.","GM PPO","Launch, Phase 1 KO to PVVB MRD")
