B.Hg=new A.a4("Technical Review","Start: -91 - End: -77","When Supplier or Suppliers participate on the sourcing for GM program. Supplier share the capability to build it usign GM1788 agenda. GM1927 13 Tech Review Check list that can be used to assess supplier, however GM 1927 16a CG4210 SQ SOR PSDS and Battery Cable audit is the proper format to evaluate during Tech Review for PSDS Suppliers. These sessions can participate GM SQE responsible of the supplier facility offered for the GM program sourced.","SQE is responsible to know floor space available of the manufacturing process offered for that program or programs.","GM1927 16a CG4210 SQ SOR PSDS and Battery Cable audit\nCG4338\nCG4210","Pre launch")
B.GP=new A.a4("Sourceability Report","Start: -91 - End: -77","This is a Supplier score related to Quality, GSC, Location Risk, Financial and Material. This report helps to identify current status on the main topics that every manufacturing duns shall to comply to be sourceable.","SQE needs to know BIQS Level and IATF status.\na) If BIQS is Blank, 0 or RED, Sourcing requires Quad Report and SQ Leadership Approval (Manufacturing Duns) \nb) If IATF Certification is WDRN, NAN, EXPD or N/A Sourcing requires Quad Report and SQ Leadership Approval (Mfg Duns). IATF Certification status of Suspended (SUSP) indicates changes at the supplier.  These changes should be investigated prior to sourcing future business. These changes could include but are not limited to: decline in quality, change in ownership and/or failure to comply with conditions of the surveillance audit.\nc) Quad Report shall be approved by SQ CT Lead prior eApproval submission.","Sourceability Report - SCMS portal","Pre launch")
B.HU=new A.a4("Exeption List","Start: -91 - End: -77","During Technical Review Supplier shall notify what kind of requirement cannot meet and this shall be documented in the M7 form (Exeption List). In case the requirement is related to Safety, the Transition Form shall be approved and submitted for PPAP. The M7 is shared from Commercial Supplier to GM Buyer.","SQE shall:\na) Ask to Supplier manufacturing facility about M7 during Kick Off meeting.\nb) Document and get approval of Transition forms.\nc) Assure keep involve GM CT Lead or GCL all time.",u.T,"Pre launch")
B.HD=new A.a4("Timing Plan","Start: -89 - End: -80","Before launch Suppliers have to demonstrate good comprehension on the timing for this new launch. During technical review Suppliers have a potencial milestones dates - these can change during the time- however Supplier shall to show a crholonogical plan which include Industrialization, Hiring and Run at Rate plan.","Ask suppliers about last timing updated and match with Framework. Assess manufacturing team have good comprehension about timing and request robust Industrialization plan.","GM1927 02\nFramework - Momentum report\nIndustrialization Plan","Pre launch")
B.HS=new A.a4("Open issues list","Start: -86 - End: -80","During review before to lanch with Suppliers and GM can be open items that need to be followed by the team responsible of the project.","Document all open items for proper follow up until close. Open items shall be closed before business award, otherwise shall be documented in M7 form (Exeption list) and keep open during PDCA Wall reviews","GM1927 05\nM7 Form (Exception list)\nPDCA Wall review","Pre launch")
B.Hy=new A.a4("Initial Flow Chart Review","Start: -84 - End: -80","Supplier shall document an initial Flow Chart according manufacturing process commited during technical review to meet GM Specific requirements.","Ask and request the Flow Chart and set up reviews with Stakeholders. Keep involved Supplier Manufacturing team responsible of the projects.","Flow chart","Pre launch")
B.Hn=new A.a4("Design Freeze","Start: -86 - End: -86","Supplier have to demonstrate evidence of Design Freeze committed date from GM Engineering. And keep planned in their PDCA Wall the industrialization plan based on this freezing.","Verify with GM DRE if Design freeze agreed with Supplier and monitor it. Any changes on that agreement, PLA shall be sumitted.","Launch Alert\nPDT Minutes","Pre launch")
B.Hs=new A.a4("Initial DFMEA Review","Start: -83 - End: -80","Supplier must share evidence about DFMEA shared by GM Engineering for all Harness families.","Verify Suppliers know about DFMEA updated and shared by GM Engineering.\n-If Suppliers are Design owner, the DFMEA can be created by Supplier Engineering-\nManufacturing team shall demonstrate evidence of DFMEA is able to all team members at facility.","DFMEA","Pre launch")
B.Hz=new A.a4("KCDS Review","Start: -82 - End: -80","KCDS shall be notified by GM Eng / Supplier Eng via Drawing and DFMEA. KCDS shall be cascaded in PFMEA, CP, Work Instruction and proper documented according 8.3.3.3 IATF norm.","SQE shall validate via PPAP the KCDS external / internal. Ask about controls","DFMEA, PFMEA, CP","Pre launch")
B.HX=new A.a4("CG4338 / CG4210","Start: -87 - End: -80","During Technical review Supplier shall demonstrate robust plan to execute every requirement requested in CG4338 and CG4210.","SQE shall verify Supplier Manufacturing facility team are aware on those CG's and be part of the PDCA Wall review.","eSOR package, CG4338, CG4210","Pre launch")
B.Hm=new A.a4("Industrialization Plan","Start: -87 - End: -80","Supplier shall evidence Industrialization plan based on the agreements taken during technical review and be aligned with GM Specific Requirements.","Match industrialization plan share by Supplier and agreed during Tech Review. If requirements are not in Industrialization plan so shall be documented in M7 Form (Exception List).",u.T,"Pre launch")
B.H3=new A.a4("Initial PFMEA Review","Start: -82 - End: -80","Supplier shall demonstrate initial PFMEA structure based on DFMEA, Gap Anlalysis, GM Specific Requirements per harness family and shall be considered all processes. Supplier can choice to share PFMEA 4th Edicion or PFMEA VDA according CG4338 rev 14.",u.I,"eSOR package\nM7 Form (Exception list)\nGM1927 21 Gap Analysis","Pre launch")
